function getInitiales(nom) {
  // Supprimer les espaces en début/fin et diviser en mots
  const mots = nom.trim().split(/\s+/).filter(mot => mot.length > 0);

  let motsUtiles;
  if (mots.length <= 2) {
    // Si 1 ou 2 mots, prendre tous
    motsUtiles = mots;
  } else {
    // Si plus de 2 mots, prendre le premier et le dernier
    motsUtiles = [mots[0], mots[mots.length - 1]];
  }

  // Extraire la première lettre de chaque mot et la mettre en majuscule
  const initiales = motsUtiles
    .map(mot => mot.charAt(0).toUpperCase())
    .join('');

  return initiales;
}

